  false,\n\t\"url\": null,\n\t\"notes\": \"Oblique images snapped from a Canon Rebel
  3Ti with a Sigma zoom lens (18-200mm focal length), a Panasonic Lumix DMC-FZ200
  (24x superzoom with variable focal length) and a Panasonic Lumix DMC-SZ7 (10x superzoom
  with variable focal length) of the arctic landscape during low altitude transects.
  Transects were conducted from small aircraft over the National Park Serviceu2019s
  Arctic Network (Bering Land Bridge National Preserve, Cape Krusenstern National
  Monument, Gates of the Arctic National Park and Preserve, Kobuk Valley National
  Park, and Noatak National Preserve) and the U.S. Fish and Wildlife Serviceu2019s
  Selawik National Wildlife Refuge in northwest Alaska.\",\n\t\"license_title\": null,\n\t\"extras\":
